import { Image } from 'react-native-web'
import { yellow1 } from './../../src/image/index';

export default function Room( {src} ) {

    const styles = StyleSheet.create({
        container: {
          flex: 1,
          padding: 24,
          backgroundColor: "#eaeaea"
        },
        title: {
          marginTop: 16,
          paddingVertical: 8,
          borderWidth: 4,
          borderColor: "#20232a",
          borderRadius: 6,
          backgroundColor: "#61dafb",
          color: "#20232a",
          textAlign: "center",
          fontSize: 30,
          fontWeight: "bold"
        }
      });

    return (
        <div>
            <Image className="room-image" source={yellow1} />
        </div>
    )



}
